Este soneto es obra de Luis de Góngora, uno de los máximos exponentes del Barroco español. El poema muestra las características típicas del estilo gongorino, con sus elaboradas metáforas y su lenguaje culto, especialmente en la forma en que aborda el tema de la luz y la oscuridad como metáforas de la vida y la muerte.
